
CREATE TABLE `mathieugravil_zzl_sports`.`seances` (`seance_id` int NOT NULL AUTO_INCREMENT,
`name` varchar(255), `sport_id` int NOT NULL , `date` DATE, `calories` INT, `distance` FLOAT, `duration` TIME , `fat_consumption` INT , `above` TIME, `average` INT, `below` TIME, `in_zone` TIME , `lower` INT, `maximum` INT, `upper` INT , `Vaverage` FLOAT, `Vmaximum` FLOAT, PRIMARY KEY  ( seance_id), CONSTRAINT fk_sport_type FOREIGN KEY(sport_id)
REFERENCES sport_type(sport_id) );

